import axios from "axios";
import React, { useEffect, useMemo, useState } from "react";
import Dog from "../models/dog";
import DogCard from "../components/DogCard"
import { Button, FormControl, Grid, InputLabel, MenuItem, Select, TextField } from "@mui/material";
import { useNavigate } from 'react-router-dom';
import BasicPaginator from "../components/paginator";

export default function IndexPage() {

    const [dogs, setDogs] = useState<Dog[]>([])
    const navigate = useNavigate();

    const [page, setPage] = React.useState<number>();

    const updatePage = useMemo(() => fetchDogSearchResults(page ?? 0), [page]);

    useEffect(() => {
        fetchDogSearchResults(1);
    }, []);

    const fetchDogSearchResults = (pageNumber: number) => {
        pageNumber = pageNumber - 1;
        axios.get(`https://api.thedogapi.com/v1/images/search?limit=25&page=${pageNumber}&order=Desc`)
            .then(response => {
                var currentdogs = [...dogs];
                currentdogs = currentdogs.concat(response.data);
                setDogs(currentdogs);
            })
            .catch(error => {
                console.error('There was an error!', error);
            });
    }
    const navigateToFavourites = () => {
        debugger;
        navigate('favourites');
    }
    const searchType: string = "10";
    const handleChange = () => {

    }
    return (
        <div>
            <div style={{ display: "inline", margin: "20px" }}>
                <Button
                    onClick={() => { navigateToFavourites() }}
                >
                    Favourites
                </Button>
                <FormControl>
                    <InputLabel id="demo-simple-select-label">Search By</InputLabel>
                    <Select
                        labelId="demo-simple-select-label"
                        id="demo-simple-select"
                        value={searchType}
                        label="Search By"
                        onChange={handleChange}
                    >
                        <MenuItem value={10}>Ten</MenuItem>
                        <MenuItem value={20}>Twenty</MenuItem>
                        <MenuItem value={30}>Thirty</MenuItem>
                    </Select>
                </FormControl>
            </div>
            <div style={{ display: "flex", flexWrap: "wrap", width: "80%", marginLeft: "13%" }}>
                {
                    dogs && dogs.length > 0 ? dogs.map((dog, index) => {
                        return (<DogCard url={dog.url} id={dog.id}
                            title={dog.breeds[0]?.name}
                            description={dog.breeds[0]?.bred_for} />)
                    }) : null
                }
            </div>
            <BasicPaginator />
        </div>
    );
}
